import React from 'react';
import { Navigate } from "react-router-dom";

const ProtectedRouteElement = ({ element: Component, loggedIn, ...rest }) => {
  return loggedIn ? <Component {...rest} /> : <Navigate to="/sign-in" replace />;
};

export default ProtectedRouteElement;
